let rec assoc (d,k,l) =
  match l with
  | [] -> d
  | (b,a)::tail when b = k -> a
  | _::tail -> assoc (d, k, tail);;

let removeDuplicates l =
  let rec helper (seen,rest) =
    match rest with
    | [] -> seen
    | h::t ->
        let seen' = if List.mem h seen then seen else h :: seen in
        let rest' = t in helper (seen', rest') in
  List.rev (helper ([], l));;

